import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header>
      <nav>

          <li><Link to="/">Home</Link></li>
          <li><Link to="/cat-fact">Cat Fact</Link></li>
          <li><Link to="/about">About</Link></li>

      </nav>
    </header>
  );
}

export default Header;
